// App.js
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar';
import DocumentConversion from './components/FileConversion';
import ImageConverter from './pages/converters/ImageConverter';
import DocumentConverter from './pages/converters/DocumentConverter';
import AudioConverter from './pages/converters/AudioConverter';
import FontConverter from './pages/converters/FontConverter';
import SignUp from './pages/auth/SignUp';
import './App.css';
import Layout from './pages/layout';

function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <Routes>
        <Route path="/" element={<Layout><DocumentConversion /></Layout>} />
        <Route path="/image_converter" element={<ImageConverter />} />
        <Route path="/document_converter" element={<DocumentConverter />} />
        <Route path="/audio_converter" element={<AudioConverter />} />
        <Route path="/font_converter" element={<FontConverter />} />
        <Route path="/sign_up" element={<SignUp />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
